<body>


<div class="container-fluid main-container">




<div id="header">



<h1 class="title toc-ignore">Testing the Adaptive Market Hypothesis: Turkey Stock Market</h1>
<h4 class="author">Başak Dilara Çevik</h4>
<h4 class="date">May 16, 2021</h4>

</div>


<ul>
<li><strong>Topic</strong>: A test of adaptive market hypothesis via <code>time-varying AR</code>model</li>
</ul>
<div id="introduction" class="section level2">
<h2>Introduction</h2>
<p>The aim of the project and the research idea must be introduced. In addition, a brief Literature Survey must be given here about the research question.<br />
The efficient market hypothesis (EMH) is a hypothesis attributed to two different studies of Samuelson (1965) and Fama (1970) that states market prices reflect all available information completely, therefore the market is efficient. Fama (1970) categorized the empirical tests of efficiency into three forms; weak, semi-strong and strong. Market efficiency has been a subject for discussion in literature for a long time. After 30 years, Lo (2004) suggested alternative market hypothesis (AMH) as an alternative theory based on an evolutionary approach, also a great contribution to the behavioral finance field. AMH’s main aim is to take the “bounded rationality” concept into the market efficiency equation. While EMH implies stability of market efficiency, AMH implies dynamic efficiency of markets due to changing market conditions such as crises, financial bubbles. Unlike EMH, AMH indicates market transition through time from efficient period to inefficient period, or vice versa is possible. That implies time-varying market efficiency by providing a basis for this term project. The aim of this project is to examine AMH in the Borsa Istanbul Turkey stock market by using The Borsa Istanbul 100 Index (BIST100/XU100) and adopting a time-varying (TV) autoregressive (AR) model. It is expected to provide further evidence for AMH and explaining the evolution of market efficiency by measuring the degree of stock market efficiency for Turkey.</p>
<p>Changes in stock prices seem to have a fair game pattern. The random walk hypothesis states that stock prices are random and therefore, unpredictable. It makes the game fair. Since the random walk is associated with the efficient market hypothesis that implies the markets quickly and efficiently react to new information about stocks, so most of the fluctuations in prices can be explained by the changes in demand and supply of any given stock, causing a random walk, in prices. TVar will help to test the assumption of the random walk process.</p>
</div>
<div id="data" class="section level2">
<h2>Data</h2>
<p>Data used in this paper consist of 5711 daily observations of XU100 index of the Borsa Istanbul Turkey stock market covering a 22-year period, from 01 July 1997 to 01 May 2019.</p>
</div>
<div id="time-series-model" class="section level2">
<h2>Time Series Model</h2>
<p>A key assumption of standard time series models is that all parameters of the data generating model are constant(stationary) across measured time period. [Assumption of stationary]</p>
<p>Time-varying parameters are smooth and locally stationary.</p>
<p>Kernel-smoothing -&gt; time varying parameters by combining the estimates of several local models spanning the entire time series. Bandwidth -&gt; Parameter which determines how many observations close to an estimation point are used to estimate the model at the point.The smaller the “b” of the kernel function, the lower number of observations will be combined and larger sensitivity to detect changes in parameters over time. However, it means less data is used and estimates are less reliable. If b&gt;1, it leads same estimates with stationary approach.</p>
<p>Time-varying coefficients model is:</p>
<p><span class="math display">\[ y_t  = \phi_{1t} y_{t-1}+ \phi_{2t} y_{t-2}+ \phi_{pt} y_{t-p} + a_t \]</span> where <span class="math display">\[ a_t ∼ N(0,\sigma^2) \]</span> is white noise, <span class="math inline">\(a_t\)</span> is an error term with <span class="math inline">\(E[\epsilon_t]=0, E[a_t^2]=\sigma^2\)</span> and <span class="math inline">\(E[a_ta_{t-m}] = 0\)</span> for all <span class="math inline">\(m≠0\)</span></p>
<p>In ordinary time series analysis,<span class="math inline">\(ϕ\)</span>’s assumed to be constant while in a time-varying approach it is supposed that coefficients of AR models vary over time.In ordinary AR models t component of coefficients don’t exist.</p>
<p>If a process is strictly stationary, the distribution of yt and all joint distributions of y random variables are the same at all time points, and are thus time-invariant.</p>
<p>EMH, <span class="math inline">\(E[x_t|I_{t-1}]=0\)</span></p>
<p><span class="math display">\[E[x_t|I_{t-1}]=0=\beta_1 u_{t-1} + \beta_2 u_{t-2} + ... \]</span></p>
<p>EMH holds if and only <span class="math inline">\(\beta_i\)</span> for all <span class="math inline">\(i\)</span>.</p>
<p><span class="math display">\[ x_t  = \alpha_0 +  \alpha_{1} x_{t-1}+ ....+ \alpha_q x_{t-q}+ u_t \]</span></p>
<p><span class="math display">\[ x_t  = \alpha_{0,t} +  \alpha_{1,t} x_{t-1}+ ....+ \alpha_{q,t} x_{t-q}+ u_t \]</span> where <span class="math inline">\(u_t\)</span> satisfies <span class="math inline">\(E[u_t]=0 E[u_t^2]=0\)</span> and <span class="math inline">\(E[u_t u_{t-m}] = 0\)</span> for all <span class="math inline">\(m=0\)</span></p>
<p>Parameter dynamics restricts the parameters in estimation of TV-AR model using data.</p>
<p><span class="math display">\[ \alpha_{l,t} = \alpha_{l,t-1} + v_{l,t},  (l=1,2,...,q) \]</span> where <span class="math inline">\(v_{l,t}\)</span> satisfies <span class="math inline">\(E[v_{l,t}]=0, E[v_{l,t} v_{l,t-m}]=0\)</span> and <span class="math inline">\(E[v_{l,t}^2] = 0\)</span> for all <span class="math inline">\(m\)</span> and <span class="math inline">\(l\)</span>.</p>
</div>
<div id="results" class="section level2">
<h2>Results</h2>
<pre class="r"><code>library(lubridate)</code></pre>
<pre><code>## 
## Attaching package: &#39;lubridate&#39;</code></pre>
<pre><code>## The following objects are masked from &#39;package:base&#39;:
