<pre><code>## The following objects are masked from &#39;package:base&#39;:
## 
##     as.Date, as.Date.numeric</code></pre>
<pre><code>## Loading required package: TTR</code></pre>
<pre><code>## Registered S3 method overwritten by &#39;quantmod&#39;:
##   method            from
##   as.zoo.data.frame zoo</code></pre>
<pre class="r"><code>library(tvReg)</code></pre>
<pre><code>## Warning: package &#39;tvReg&#39; was built under R version 4.0.5</code></pre>
<pre><code>## Loading required package: Matrix</code></pre>
<pre><code>## Funded by the Horizon 2020. Framework Programme of the European Union.</code></pre>
<pre class="r"><code>library(tsbox)</code></pre>
<pre><code>## Warning: package &#39;tsbox&#39; was built under R version 4.0.5</code></pre>
<pre class="r"><code>library(tseries)</code></pre>
<pre><code>## Warning: package &#39;tseries&#39; was built under R version 4.0.5</code></pre>
<pre class="r"><code>library(PerformanceAnalytics)</code></pre>
<pre><code>## Warning: package &#39;PerformanceAnalytics&#39; was built under R version 4.0.5</code></pre>
<pre><code>## 
## Attaching package: &#39;PerformanceAnalytics&#39;</code></pre>
<pre><code>## The following object is masked from &#39;package:graphics&#39;:
## 
##     legend</code></pre>
<pre class="r"><code>##

tt &lt;- (1:1000)/1000
beta &lt;- cbind(0.5 * cos(2 * pi * tt), (tt - 0.5)^2)
y &lt;- numeric(1000)
y[1] &lt;- 0.5
y[2] &lt;- -0.2
## y(t) = beta1(t) y(t-1) + beta2(t) y(t-2) + ut
for (t in 3:1000) {
    y[t] &lt;- y[(t - 1):(t - 2)] %*% beta[t, ] + rnorm(1)
}
Y &lt;- tail(y, 500)

## ar.ols &amp; tvAR comparison 
## in a plot
model.ar.2p &lt;- ar.ols(Y, aic = FALSE, order = 2, intercept = FALSE, demean = FALSE)
model.tvAR.2p &lt;- tvAR(Y, p = 2, type = &quot;none&quot;, est = &quot;ll&quot;)</code></pre>
<pre><code>## Calculating regression bandwidth...</code></pre>
<pre class="r"><code>## Simulate a AR(1) process with coefficients depending on z
z &lt;- runif(2000, -1, 1)
beta &lt;- (z - 0.5)^2
y &lt;- numeric(2000)
y[1] &lt;- 0.5
error &lt;- rnorm(2000)
## y(t) = beta1(z(t)) y(t-1) + ut
for (t in 2:2000) {
    y[t] &lt;- y[(t - 1)] %*% beta[t] + error[t]
}

## Remove initial conditions effects
Z &lt;- tail(z, 1500)
Y &lt;- tail(y, 1500)

## Coefficient estimates of process Y with ar.ols and tvAR
model.ar.1p &lt;- ar.ols(Y, aic = FALSE, order = 1, intercept = FALSE, demean = FALSE)
model.tvAR.1p.z &lt;- tvAR(Y, p = 1, z = Z, type = &quot;none&quot;, est = &quot;ll&quot;)</code></pre>
<pre><code>## Calculating regression bandwidth...</code></pre>
<pre class="r"><code>## 80% confidence interval using normal wild bootstrap for object of the class
## attribute tvar with 200 bootstrap resamples
model.tvAR.80 &lt;- confint(model.tvAR.1p.z, tboot = &quot;wild2&quot;, level = 0.8, runs = 50)

## Plot coefficient estimates of objects of the class attribute tvar.
