<div id="conclusion" class="section level2">
<h2>Conclusion</h2>
<p>If coefficients are at the same level, it is invariant, meaning that the autoregressive process of stock prices doesn’t change with time and accordingly specific events such as bubbles, crises. If it is decreasing or increasing it means that efficiency changing over time, if coefficients have peaks and downs related to those specific events it means that we have findings that support Adaptive Market Hypothesis. The time-varying autoregressive coefficient is slightly decreasing over time. For the first-order lag, it is possible to mention lower predictability of stock returns and market goes toward efficiency. In the TV-AR model, the deviation of coefficients is the proxy for the degree of market inefficiency. The market is generally efficient. There is no specific deviation in general. We observe a very little change in market efficiency around the 2001 crisis and low variation between 2008-2009 the Great Recession. In Turkey, stock market efficiency is both varying over time and influenced by the market conditions. Empirical results are not providing support for Adaptive Market Hypothesis, however, the behavior of the market is pretty much in line with the hypothesis regarding coefficients’ decreasing behaviors.</p>
</div>
